Text:
Paşinyan Qarabağ ermənilərini vəziyyəti gərginləşdirməməyə çağırıb

Paşinyan Laçın yolunda azərbaycanlı ekofəalların aksiyası fonunda bölgədəki ermənilərin hadisələrə daha təmkinli yanaşmasının, baş verənləri analiz etməsinin önəmli olmasından danışıb.

@apa_az

🔥🧯“Sədərək” ticarət mərkəzində yanğından son məlumat: 

🔹Yanğın 3 saata lokallaşdırılıb;

🔹Bir polis əməkdaşı tüstüdən zəhərlənib, xəstəxanaya yerləşdirilib;

🔹Obyektlərin birindən oğurluğa cəhd edən 2 nəfər saxlanılıb. https://t.co/cUjbrwkpVc

🌡️❄️Bakıda havanın temperaturu 10-12 dərəcə enəcək

🔹Qar yağacaq;
🔹Çovğun olacaq;
🔹Yollar buz bağlayacaq.

